Category	Feature, Horror, Vampire

Starring	Steven St Croix, Michael Vegas, Bonnie Rotten, Marie McCray, Casey Calvert, Penny Pax, Aaliyah Love, Jesse Jane, Ryan Driller, Stevie Shae

The three Eternals, Kat, Jade and Mina, are the epitome of every man's desires. They each possess a powerful amulet that can transform any vampire back to his normal human existence, but only when placed together. They travel far from Romaine to prevent vampire Adrian from letting the world know of their existence. Adrian is a reckless nymphomaniac who seduces innocent women. He gives his victims one last romp before he bites their necks and disposes their bodies. The girls' protector and occasionally fuck buddy, Damien, has promised to not let Adrian blow their cover and to do everything he can to keep humanity at peace!

